They gave to them the cities of refuge, Shechem in the hill country of Ephraim with its pasture lands and Gezer with its pasture lands, 
Jokmeam with its pasture lands, Beth Horon with its pasture lands, 
Aijalon with its pasture lands, Gath Rimmon with its pasture lands; 
and out of the half-tribe of Manasseh, Aner with its pasture lands, and Bileam with its pasture lands, for the rest of the family of the sons of Kohath. 
To the sons of Gershom were given, out of the family of the half-tribe of Manasseh, Golan in Bashan with its pasture lands, and Ashtaroth with its pasture lands; 
and out of the tribe of Issachar, Kedesh with its pasture lands, Daberath with its pasture lands, 
Ramoth with its pasture lands, and Anem with its pasture lands; 
and out of the tribe of Asher, Mashal with its pasture lands, Abdon with its pasture lands, 
Hukok with its pasture lands, and Rehob with its pasture lands; 
and out of the tribe of Naphtali, Kedesh in Galilee with its pasture lands, Hammon with its pasture lands, and Kiriathaim with its pasture lands. 
To the rest of the Levites, the sons of Merari, were given, out of the tribe of Zebulun, Rimmono with its pasture lands, and Tabor with its pasture lands; 
and beyond the Jordan at Jericho, on the east side of the Jordan, were given them out of the tribe of Reuben: Bezer in the wilderness with its pasture lands, Jahzah with its pasture lands, 
Kedemoth with its pasture lands, and Mephaath with its pasture lands;

So all Israel were listed by genealogies; and behold, they are written in the book of the kings of Israel. Judah was carried away captive to Babylon for their disobedience. 
Now the first inhabitants who lived in their possessions in their cities were Israel, the priests, the Levites, and the temple servants. 
In Jerusalem, there lived of the children of Judah, of the children of Benjamin, and of the children of Ephraim and Manasseh: 
Uthai the son of Ammihud, the son of Omri, the son of Imri, the son of Bani, of the children of Perez the son of Judah. 
Of the Shilonites: Asaiah the firstborn and his sons. 
Of the sons of Zerah: Jeuel and their brothers, six hundred ninety. 
Of the sons of Benjamin: Sallu the son of Meshullam, the son of Hodaviah, the son of Hassenuah; 
and Ibneiah the son of Jeroham, and Elah the son of Uzzi, the son of Michri; and Meshullam the son of Shephatiah, the son of Reuel, the son of Ibnijah; 
and their brothers, according to their generations, nine hundred fifty-six. All these men were heads of fathers’ households by their fathers’ houses. 
Of the priests: Jedaiah, Jehoiarib, Jachin, 
and Azariah the son of Hilkiah, the son of Meshullam, the son of Zadok, the son of Meraioth, the son of Ahitub, the ruler of God’s house; 
and Adaiah the son of Jeroham, the son of Pashhur, the son of Malchijah; and Maasai the son of Adiel, the son of Jahzerah, the son of Meshullam, the son of Meshillemith, the son of Immer;

David made himself houses in David’s city; and he prepared a place for God’s ark, and pitched a tent for it. 
Then David said, “No one ought to carry God’s ark but the Levites. For Yahweh has chosen them to carry God’s ark, and to minister to him forever.” 
David assembled all Israel at Jerusalem, to bring up Yahweh’s ark to its place, which he had prepared for it. 
David gathered together the sons of Aaron and the Levites: 
of the sons of Kohath, Uriel the chief, and his brothers one hundred twenty; 
of the sons of Merari, Asaiah the chief, and his brothers two hundred twenty; 
of the sons of Gershom, Joel the chief, and his brothers one hundred thirty; 
of the sons of Elizaphan, Shemaiah the chief, and his brothers two hundred; 
of the sons of Hebron, Eliel the chief, and his brothers eighty; 
of the sons of Uzziel, Amminadab the chief, and his brothers one hundred twelve. 
David called for Zadok and Abiathar the priests, and for the Levites: for Uriel, Asaiah, Joel, Shemaiah, Eliel, and Amminadab, 
and said to them, “You are the heads of the fathers’ households of the Levites. Sanctify yourselves, both you and your brothers, that you may bring the ark of Yahweh, the God of Israel, up to the place that I have prepared for it. 
For because you didn’t carry it at first, Yahweh our God broke out in anger against us, because we didn’t seek him according to the ordinance.” 
So the priests and the Levites sanctified themselves to bring up the ark of Yahweh, the God of Israel.

The children of the Levites bore God’s ark on their shoulders with its poles, as Moses commanded according to Yahweh’s word. 
David spoke to the chief of the Levites to appoint their brothers as singers with instruments of music, stringed instruments, harps, and cymbals, sounding aloud and lifting up their voices with joy. 
So the Levites appointed Heman the son of Joel; and of his brothers, Asaph the son of Berechiah; and of the sons of Merari their brothers, Ethan the son of Kushaiah; 
and with them their brothers of the second rank: Zechariah, Ben, Jaaziel, Shemiramoth, Jehiel, Unni, Eliab, Benaiah, Maaseiah, Mattithiah, Eliphelehu, Mikneiah, Obed-Edom, and Jeiel, the doorkeepers. 
So the singers, Heman, Asaph, and Ethan, were given cymbals of bronze to sound aloud; 
and Zechariah, Aziel, Shemiramoth, Jehiel, Unni, Eliab, Maaseiah, and Benaiah, with stringed instruments set to Alamoth; 
and Mattithiah, Eliphelehu, Mikneiah, Obed-Edom, Jeiel, and Azaziah, with harps tuned to the eight-stringed lyre, to lead. 
Chenaniah, chief of the Levites, was over the singing. He taught the singers, because he was skillful. 
Berechiah and Elkanah were doorkeepers for the ark. 
Shebaniah, Joshaphat, Nethanel, Amasai, Zechariah, Benaiah, and Eliezer, the priests, blew the trumpets before God’s ark; and Obed-Edom and Jehiah were doorkeepers for the ark.

Then the trees of the forest will sing for joy before Yahweh, for he comes to judge the earth. 
Oh give thanks to Yahweh, for he is good, for his loving kindness endures forever. 
Say, “Save us, God of our salvation! Gather us together and deliver us from the nations, to give thanks to your holy name, to triumph in your praise.” 
Blessed be Yahweh, the God of Israel, from everlasting even to everlasting. All the people said, “Amen,” and praised Yahweh. 
So he left Asaph and his brothers there before the ark of Yahweh’s covenant, to minister before the ark continually, as every day’s work required; 
and Obed-Edom with their sixty-eight relatives; Obed-Edom also the son of Jeduthun and Hosah to be doorkeepers; 
and Zadok the priest and his brothers the priests, before Yahweh’s tabernacle in the high place that was at Gibeon, 
to offer burnt offerings to Yahweh on the altar of burnt offering continually morning and evening, even according to all that is written in Yahweh’s law, which he commanded to Israel; 
and with them Heman and Jeduthun and the rest who were chosen, who were mentioned by name, to give thanks to Yahweh, because his loving kindness endures forever; 
and with them Heman and Jeduthun with trumpets and cymbals for those that should sound aloud, and with instruments for the songs of God, and the sons of Jeduthun to be at the gate. 
All the people departed, each man to his house; and David returned to bless his house.

for the show bread also, and for the fine flour for a meal offering, whether of unleavened wafers, or of that which is baked in the pan, or of that which is soaked, and for all measurements of quantity and size; 
and to stand every morning to thank and praise Yahweh, and likewise in the evening; 
and to offer all burnt offerings to Yahweh on the Sabbaths, on the new moons, and on the set feasts, in number according to the ordinance concerning them, continually before Yahweh; 
and that they should keep the duty of the Tent of Meeting, the duty of the holy place, and the duty of the sons of Aaron their brothers for the service of Yahweh’s house.

Now the first lot came out for Asaph to Joseph; the second to Gedaliah, he and his brothers and sons were twelve; 
the third to Zaccur, his sons and his brothers, twelve; 
the fourth to Izri, his sons and his brothers, twelve; 
the fifth to Nethaniah, his sons and his brothers, twelve; 
the sixth to Bukkiah, his sons and his brothers, twelve; 
the seventh to Jesharelah, his sons and his brothers, twelve; 
the eighth to Jeshaiah, his sons and his brothers, twelve; 
the ninth to Mattaniah, his sons and his brothers, twelve; 
the tenth to Shimei, his sons and his brothers, twelve; 
the eleventh to Azarel, his sons and his brothers, twelve; 
the twelfth to Hashabiah, his sons and his brothers, twelve; 
for the thirteenth, Shubael, his sons and his brothers, twelve; 
for the fourteenth, Mattithiah, his sons and his brothers, twelve; 
for the fifteenth to Jeremoth, his sons and his brothers, twelve; 
for the sixteenth to Hananiah, his sons and his brothers, twelve; 
for the seventeenth to Joshbekashah, his sons and his brothers, twelve; 
for the eighteenth to Hanani, his sons and his brothers, twelve; 
for the nineteenth to Mallothi, his sons and his brothers, twelve; 
for the twentieth to Eliathah, his sons and his brothers, twelve; 
for the twenty-first to Hothir, his sons and his brothers, twelve; 
for the twenty-second to Giddalti, his sons and his brothers, twelve; 
for the twenty-third to Mahazioth, his sons and his brothers, twelve;

The eighth captain for the eighth month was Sibbecai the Hushathite, of the Zerahites. In his division were twenty-four thousand. 
The ninth captain for the ninth month was Abiezer the Anathothite, of the Benjamites. In his division were twenty-four thousand. 
The tenth captain for the tenth month was Maharai the Netophathite, of the Zerahites. In his division were twenty-four thousand. 
The eleventh captain for the eleventh month was Benaiah the Pirathonite, of the children of Ephraim. In his division were twenty-four thousand. 
The twelfth captain for the twelfth month was Heldai the Netophathite, of Othniel. In his division were twenty-four thousand. 
Furthermore over the tribes of Israel: of the Reubenites, Eliezer the son of Zichri was the ruler; of the Simeonites, Shephatiah the son of Maacah; 
of Levi, Hashabiah the son of Kemuel; of Aaron, Zadok; 
of Judah, Elihu, one of the brothers of David; of Issachar, Omri the son of Michael; 
of Zebulun, Ishmaiah the son of Obadiah; of Naphtali, Jeremoth the son of Azriel; 
of the children of Ephraim, Hoshea the son of Azaziah; of the half-tribe of Manasseh, Joel the son of Pedaiah; 
of the half-tribe of Manasseh in Gilead, Iddo the son of Zechariah; of Benjamin, Jaasiel the son of Abner; 
of Dan, Azarel the son of Jeroham. These were the captains of the tribes of Israel. 
But David didn’t take the number of them from twenty years old and under, because Yahweh had said he would increase Israel like the stars of the sky.

Now therefore, in the sight of all Israel, Yahweh’s assembly, and in the audience of our God, observe and seek out all the commandments of Yahweh your God, that you may possess this good land, and leave it for an inheritance to your children after you forever. 
You, Solomon my son, know the God of your father, and serve him with a perfect heart and with a willing mind; for Yahweh searches all hearts, and understands all the imaginations of the thoughts. If you seek him, he will be found by you; but if you forsake him, he will cast you off forever. 
Take heed now, for Yahweh has chosen you to build a house for the sanctuary. Be strong, and do it.” 
Then David gave to Solomon his son the plans for the porch of the temple, for its houses, for its treasuries, for its upper rooms, for its inner rooms, for the place of the mercy seat; 
and the plans of all that he had by the Spirit, for the courts of Yahweh’s house, for all the surrounding rooms, for the treasuries of God’s house, and for the treasuries of the dedicated things; 
also for the divisions of the priests and the Levites, for all the work of the service of Yahweh’s house, and for all the vessels of service in Yahweh’s house— 
of gold by weight for the gold for all vessels of every kind of service, for all the vessels of silver by weight, for all vessels of every kind of service;

by weight also for the lamp stands of gold, and for its lamps, of gold, by weight for every lamp stand and for its lamps; and for the lamp stands of silver, by weight for every lamp stand and for its lamps, according to the use of every lamp stand; 
and the gold by weight for the tables of show bread, for every table; and silver for the tables of silver; 
and the forks, the basins, and the cups, of pure gold; and for the golden bowls by weight for every bowl; and for the silver bowls by weight for every bowl; 
and for the altar of incense, refined gold by weight; and gold for the plans for the chariot, and the cherubim that spread out and cover the ark of Yahweh’s covenant. 
“All this”, David said, “I have been made to understand in writing from Yahweh’s hand, even all the works of this pattern.” 
David said to Solomon his son, “Be strong and courageous, and do it. Don’t be afraid, nor be dismayed, for Yahweh God, even my God, is with you. He will not fail you nor forsake you, until all the work for the service of Yahweh’s house is finished. 
Behold, there are the divisions of the priests and the Levites for all the service of God’s house. Every willing man who has skill for any kind of service shall be with you in all kinds of work. Also the captains and all the people will be entirely at your command.”

David the king said to all the assembly, “Solomon my son, whom alone God has chosen, is yet young and tender, and the work is great; for the palace is not for man, but for Yahweh God. 
Now I have prepared with all my might for the house of my God the gold for the things of gold, the silver for the things of silver, the bronze for the things of bronze, iron for the things of iron, and wood for the things of wood, also onyx stones, stones to be set, stones for inlaid work of various colors, all kinds of precious stones, and marble stones in abundance. 
In addition, because I have set my affection on the house of my God, since I have a treasure of my own of gold and silver, I give it to the house of my God, over and above all that I have prepared for the holy house: 
even three thousand talents of gold, of the gold of Ophir, and seven thousand talents of refined silver, with which to overlay the walls of the houses; 
of gold for the things of gold, and of silver for the things of silver, and for all kinds of work to be made by the hands of artisans. Who then offers willingly to consecrate himself today to Yahweh?” 
Then the princes of the fathers’ households, and the princes of the tribes of Israel, and the captains of thousands and of hundreds, with the rulers over the king’s work, offered willingly;
